import React from 'react';

import FriendList from './FriendList';

import Me from '../img/me.png';

import './style.css';

export default function Friends() {
    return (
        <section className="Friends" >
            <div></div>
            <FriendList img={Me} txt="Amigos" isFriend={true}/>
        </section>
    );
}
